  false,\n\t\"url\": null,\n\t\"notes\": \"This data layer (PAC_PRS.txt) is one of
  five point coverages of known sediment samples, inspections, and probes from the
  usSEABED data collection for the U.S. Pacific continental margin integrated using
  the dbSEABED software system. This data layer represents the parsed (PRS) output
  of the dbSEABED mining software. It contains the numeric results parsed from text-based
  descriptions held in the data resource files (DRF). Because it relies on descriptions,
  the PRS data are less precise than the extracted data (PAC_EXT), but may include
  information on outsized elements and consolidation that are often not in lab-analyzed
  data. This file contains the same data fields as the extracted (PAC_EXT) and calculated
  (PAC_CLC) data files, and the three files may be combined.\",\n\t\"license_title\":
